import * as appModule from '../app.js';
import request from 'supertest';
import { expect } from 'chai';


const app = appModule.default;   // default export
const { greet } = appModule;     // named export



describe('GET /', () => {
  it('should return Hello CI/CD!', async () => {
    const res = await request(app).get('/');
    expect(res.status).to.equal(200);
    expect(res.text).to.equal('Hello CI/CD!');
  });
});

describe('GET /hello', () => {
  it('should greet World by default', async () => {
    const res = await request(app).get('/hello');
    expect(res.status).to.equal(200);
    expect(res.text).to.equal('Hello World!');
  });

  it('should greet a given name', async () => {
    const res = await request(app).get('/hello?name=Chanda');
    expect(res.status).to.equal(200);
    expect(res.text).to.equal('Hello Chanda!');
  });
});

describe('POST /sum', () => {
  it('should return sum of two numbers', async () => {
    const res = await request(app)
      .post('/sum')
      .send({ a: 2, b: 3 });
    expect(res.status).to.equal(200);
    expect(res.body.result).to.equal(5);
  });

  it('should return 400 for invalid input', async () => {
    const res = await request(app)
      .post('/sum')
      .send({ a: 2, b: 'x' });
    expect(res.status).to.equal(400);
    expect(res.body).to.have.property('error');
  });
});

describe('greet helper', () => {
  it('should return correct greeting', () => {
    expect(greet()).to.equal('Hello CI/CD!');
    expect(greet('Chanda')).to.equal('Hello Chanda!');
  });
});

// app.js
import express from 'express';


const app = express();

// Middleware
app.use(express.json());

// Helper function
function greet(name = "CI/CD") {
  return `Hello ${name}!`;
}

// Routes
function rootHandler(req, res) {
  res.send(greet());
}

function helloHandler(req, res) {
  const name = req.query.name || "World";
  res.send(greet(name));
}

function sumHandler(req, res) {
  const { a, b } = req.body;
  if (typeof a !== 'number' || typeof b !== 'number') {
    return res.status(400).send({ error: "Invalid numbers" });
  }
  res.send({ result: a + b });
}

// Register routes
app.get('/', rootHandler);
app.get('/hello', helloHandler);
app.post('/sum', sumHandler);

export { rootHandler, helloHandler, sumHandler, greet };
export default app;
